import Modal from "../../Modal/Modal";
import "./Search.scss";

function SearchItem({data}) {
  return (
    <div>
      <div className="search_item">
        <img
          className="search_img"
          src= {data && data.thumb_url}
          alt="hinh anh"
        />
        <p className="search_name">{data && data.name}</p>
      </div>

      <Modal data={data}/>
    </div>

  );
}

export default SearchItem;
